CREATE DATABASE bio_mob;
USE bio_mob;
CREATE SCHEMA livre;

CREATE TABLE livre.Bateria (
   numero_serie_bateria varchar(50) PRIMARY KEY NOT NULL,
   bateria_status varchar(50) NULL,
   carga varchar(5) NULL
);
CREATE TABLE livre.Equipamento(
    numero_serie_equipamento varchar(50) PRIMARY KEY NOT NULL,
	nome varchar(100) NULL,
	equipamento_status varchar(50) NULL,
	qr_code varchar(60) NULL,
	foto varchar(200) NULL,
	foto64 varchar(max) NULL
);
CREATE TABLE livre.Nivel(
	id int PRIMARY KEY NOT NULL,
	tipo_usuario varchar(45) NULL,
	painel_de_gerenciamento bit NULL,
	atualizar_equipamentos bit NULL,
	estoque_de_equipamentos bit NULL,
	solicitacao_de_equipamentos bit NULL,
	devolucao_de_equipamentos bit NULL
);
CREATE TABLE livre.Status(
	id int PRIMARY KEY NOT NULL,
	tipo varchar(100) NOT NULL
);
CREATE TABLE livre.Video(
	id int PRIMARY KEY NOT NULL,
	url varchar(250) NOT NULL
);
CREATE TABLE livre.Lesao(
	id int PRIMARY KEY NOT NULL,
	tipo varchar(100) NOT NULL
);
CREATE TABLE livre.Bateria_associada(
	id int PRIMARY KEY NOT NULL,
	id_bateria varchar(50) NOT NULL,
	id_equipamento varchar(50) NOT NULL,
    CONSTRAINT fk_ba_bat FOREIGN KEY (id_bateria) REFERENCES livre.Bateria (numero_serie_bateria),
    CONSTRAINT fk_ba_equi FOREIGN KEY (id_equipamento) REFERENCES livre.Equipamento (numero_serie_equipamento)
);
CREATE TABLE livre.Parceiro(
    documento_empresa varchar(25) PRIMARY KEY NOT NULL,
	nome_fantasia varchar(200) NULL,
	razao_social varchar(200) NULL,
	email varchar(250) NULL,
	inscricao_estadual varchar(50) NULL,
	tipo_de_servico varchar(100) NULL,
	telefone varchar(80) NULL,
	cep varchar(30) NULL,
	logradouro varchar(200) NULL,
	numero varchar(15) NULL,
	complemento varchar(200) NULL,
	bairro varchar(50) NULL,
	cidade varchar(100) NULL,
	estado varchar(100) NULL,
	foto varchar(max) NULL,
	foto_reconhecimento varchar(max) NULL,
	foto64 varchar(max) NULL,
	foto_reconhecimento64 varchar(max) NULL,
	nivel int NULL,
	agencia varchar(20) NULL,
	n_conta varchar(20) NULL,
	banco varchar(20) NULL,
	tipo varchar(20) NULL,
	latitude float NULL,
	longitude float NULL,
    CONSTRAINT fk_parc_nivel FOREIGN KEY (nivel) REFERENCES livre.Nivel (id)
);
CREATE TABLE livre.Estoque(
	kit int PRIMARY KEY NOT NULL,
	data_atualizacao datetime NULL,
	ativo bit NULL,
	tempo_utilizacao int NULL,
	evento varchar(100) NULL,
	numero_serie_equipamento varchar(50) NOT NULL,
	numero_serie_bateria varchar(50) NOT NULL,
	emprestado bit NULL,
	qr64 varchar(max) NULL,
	qr varchar(200) NULL,
	latitude float NULL,
	longitude float NULL,
	altitude float NULL,
	velocidade float NULL,
	direcao float NULL,
	PDOP float NULL,
	VDOP float NULL,
	satelites int NULL,
	rodaGirando bit NULL,
	panico bit NULL,
	RFID_equipamento varchar(200) NULL,
	RFID_bateria varchar(200) NULL,
	parceiro varchar(25) NULL,
    CONSTRAINT fk_est_equi FOREIGN KEY (numero_serie_equipamento) REFERENCES livre.Equipamento (numero_serie_equipamento),
    CONSTRAINT fk_est_bat FOREIGN KEY (numero_serie_bateria) REFERENCES livre.Bateria (numero_serie_bateria),
    CONSTRAINT fk_est_parc FOREIGN KEY (parceiro) REFERENCES livre.Parceiro (documento_empresa)
);
CREATE TABLE livre.Funcionario(
    documento varchar(20) PRIMARY KEY NOT NULL,
	nome varchar(200) NULL,
	email varchar(250) NULL,
	data_de_nascicmento datetime NULL,
	cep varchar(30) NULL,
	logradouro varchar(200) NULL,
	numero varchar(15) NULL,
	complemento varchar(200) NULL,
	bairro varchar(50) NULL,
	cidade varchar(100) NULL,
	estado varchar(100) NULL,
	foto_documento varchar(200) NULL,
	foto_com_documento varchar(200) NULL,
	foto_reconhecimento varchar(200) NULL,
	foto_documento64 varchar(max) NULL,
	foto_com_documento64 varchar(max) NULL,
	foto_reconhecimento64 varchar(max) NULL,
	nivel int NULL,
	senha varchar(100) NULL,
	telefone varchar(80) NULL,
	sobrenome varchar(250) NULL,
	parceiro varchar(25) NULL,
	kitlivre bit NULL,
    CONSTRAINT fk_func_nivel FOREIGN KEY (nivel) REFERENCES livre.Nivel (id),
    CONSTRAINT fk_func_parc FOREIGN KEY (parceiro) REFERENCES livre.Parceiro (documento_empresa)
);
CREATE TABLE livre.Usuario(
    documento varchar(20) PRIMARY KEY NOT NULL,
	nome varchar(200) NULL,
	email varchar(250) NULL,
	data_de_nascicmento datetime NULL,
	telefone_fixo varchar(80) NULL,
	telefone_celular varchar(80) NULL,
	cep varchar(30) NULL,
	logradouro varchar(200) NULL,
	numero varchar(15) NULL,
	complemento varchar(200) NULL,
	bairro varchar(50) NULL,
	cidade varchar(100) NULL,
	estado varchar(100) NULL,
	situacao_lesao varchar(20) NULL,
	nivel_lesao varchar(25) NULL,
	detalhe_lesao varchar(500) NULL,
	foto_documento varchar(200) NULL,
	foto_com_documento varchar(200) NULL,
	foto_reconhecimento varchar(200) NULL,
	foto_documento64 varchar(max) NULL,
	foto_com_documento64 varchar(max) NULL,
	foto_reconhecimento64 varchar(max) NULL,
	nivel int NULL,
	senha varchar(100) NULL,
	telefone varchar(80) NULL,
	sobrenome varchar(250) NULL,
	ativo bit NULL,
    CONSTRAINT fk_usu_nivel FOREIGN KEY (nivel) REFERENCES livre.Nivel (id)
);
CREATE TABLE livre.Locacao(
	id int IDENTITY(1,1) PRIMARY KEY NOT NULL,
	data_solicitacao datetime NULL,
	data_devolucao datetime NULL,
	tempo_espera decimal(18, 0) NULL,
	avaliacao int NULL,
	numero_serie_equipamento varchar(50) NULL,
	numero_serie_bateria varchar(50) NULL,
	documento varchar(20) NULL,
	devolvido bit NULL,
	foto varchar(300) NULL,
	sugestao varchar(500) NULL,
	locacao_status varchar(100) NULL,
	kit int NULL,
    CONSTRAINT fk_loc_usu FOREIGN KEY (documento) REFERENCES livre.Usuario (documento),
    CONSTRAINT fk_loc_estoq FOREIGN KEY (kit) REFERENCES livre.Estoque (kit),
    CONSTRAINT fk_loc_equi FOREIGN KEY (numero_serie_equipamento) REFERENCES livre.Equipamento (numero_serie_equipamento),
    CONSTRAINT fk_loc_bat FOREIGN KEY (numero_serie_bateria) REFERENCES livre.Bateria (numero_serie_bateria)
);

